  //Function to return a list containing the intersection of two arrays.
  private static ArrayList<Integer> printIntersection(int[] arr1, int[] arr2, int n, int m) {
    // add your code here
    int i = 0, j = 0;
    ArrayList<Integer> result = new ArrayList<>();

    while (i < n && j < m) {
      while (i > 0 && i < n && arr1[i] == arr1[i - 1]) {
        i++;
      }

      while (j > 0 && j < m && arr2[j] == arr2[j - 1]) {
        j++;
      }

      if (i >= n || j >= m) {
        break;
      }

      if (arr1[i] < arr2[j]) {
        i++;
      } else if (arr1[i] > arr2[j]) {
        j++;
      } else {
        result.add(arr1[i]);
        i++;
        j++;
      }
    }

    if (result.isEmpty()) {
      result.add(-1);
    }

    return result;
  }

  private static void testIntersectionOfTwoSortedArrays1() {
    int[] arr1 = {1, 2, 3, 4};
    int[] arr2 = {2, 4, 6, 7, 8};

    System.out.println(printIntersection(arr1, arr2, arr1.length, arr2.length));
  }

  private static void testIntersectionOfTwoSortedArrays2() {
    int[] arr1 = {1, 2, 2, 3, 4};
    int[] arr2 = {2, 2, 4, 6, 7, 8};

    System.out.println(printIntersection(arr1, arr2, arr1.length, arr2.length));
  }

  private static void testIntersectionOfTwoSortedArrays3() {
    int[] arr1 = {1, 2};
    int[] arr2 = {3, 4};

    System.out.println(printIntersection(arr1, arr2, arr1.length, arr2.length));
  }

